import * as a from './StyledLogin.js';

function Login() {
  return (
    <a.LoginBox>
      <a.Logo src={require('../../images/LogoBlack.png')}/>
      <a.InputBox placeholder='이메일'/>
      <a.InputBox type='password' placeholder='비밀번호'/>
      <a.EyeIcon src={require('../../images/eye.png')}/>
      <a.LoginError>아이디나 비밀번호가 일치하지않습니다.</a.LoginError>
      <a.LoginBtn >로그인</a.LoginBtn>
      <a.FindID></a.FindID>
      <a.FindPassword></a.FindPassword>
    </a.LoginBox>
  );
}

export default Login;
